import React, { lazy, Suspense } from 'react';
import { Row, Col } from 'antd';
import { GlobalLoading } from './../../components';
//import { ToolPost } from './Components';
import './styles.css';
const ToolPost = lazy(() => import('./Components/ToolPost'));

function Home(props) {
    return (
        <Row gutter={[16, 16]}>
            <Col lg={12}>
                <Suspense fallback={<GlobalLoading />}>
                    <ToolPost />
                </Suspense>
            </Col>
            <Col lg={12}>
                <Suspense fallback={<GlobalLoading />}>
                    <ToolPost />
                </Suspense>
            </Col>
        </Row>
    );
}
export default Home;
